// src/pages/DashboardPage.js
import React from 'react';
import UserProfile from '../components/UserProfile';
import BorrowedBooks from '../components/BorrowedBooks';
import ReadingHistory from '../components/ReadingHistory';
import AccountSettings from '../components/AccountSettings';
import './DashboardPage.css';

const DashboardPage = () => {
  const user = {
    name: 'John Doe',
    email: 'john.doe@example.com',
    profilePicture: '.',
};

  const borrowedBooks = [
    { id: 1, title: 'Borrowed Book 1', author: 'Author 1', dueDate: '2024-08-01' },
    { id: 2, title: 'Borrowed Book 2', author: 'Author 2', dueDate: '2024-08-05' },
    // Add more borrowed books here
  ];

  const readingHistory = [
    { id: 1, title: 'Read Book 1', author: 'Author 1', finishedDate: '2024-07-20' },
    { id: 2, title: 'Read Book 2', author: 'Author 2', finishedDate: '2024-07-15' },
    // Add more read books here
  ];

  return (
    <div className="dashboard-page">
      <UserProfile user={user} />
      <BorrowedBooks books={borrowedBooks} />
      <ReadingHistory books={readingHistory} />
      <AccountSettings user={user} />
    </div>
  );
};

export default DashboardPage;
